import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './components/HeaderBlock/HeaderBlock.css'

const AppList = () => {
  const items = ['items 1', 'items 2', 'items 3', 'items 4'];
  const firstItem = <li>items 0</li>;

  const isAuth = false;

  return (
    <ul>
      {isAuth ? firstItem: null}

      {items.map(item => <li>{item}</li>)}
      <li>{items[0]}</li>
      <li>{items[1]}</li>
    </ul>
  );
}

const AppHeader = () => {
  // const margin = '50';

  // const styleH = {
  //   color: 'red',
  //   marginLeft: `${margin}px`,
  //   marginBottom: `${margin}px`,
  // }
  return <h1 className ='header'>Hello World!</h1>
}

const AppInput = () => {
  const placeholder = 'Test';

  return (
    <label>
      <input placeholder = {placeholder}/>
    </label>
  )
}

const App = () => {
  return (
    <>
      <AppHeader />
      <AppInput />
      <AppList />
      <AppList />
    </>
    );
}


ReactDOM.render(<App />, document.getElementById('root'));
